class Solution {
public:
    int lengthOfLongestSubstring(string s) {
        int chars[94]={0};
        int result = 0;
        bool dup = false;
        int temp_index_start=0;
        int temp_index_end = 0;
        for(int i=0;i<s.size();i++)
        {
            int temp_res = 0;
            temp_index_start = i;
            memset(chars,0, sizeof(int)*94);
            for(int j = i; j<s.size();j++)
            {
                if(i>=temp_index_start && j<temp_index_end){break;}// in window,skip
                int* charptr = chars+(s[j]-' ');
                if(*charptr != 1)
                {    
                    *charptr = 1;
                    temp_res ++;
                    temp_index_end ++;
                }else{
                    
                    temp_index_end = j;
                    break;
                }

            }
            result = result < temp_res? temp_res : result;
        }
        return result;
    }
};
